// display function to show all elements
void disp(vector<int> &arr)
{
    for (int i = 0; i <= arr.size() - 1; i++)
    {
        cout << arr[i] << " ";
    }
}

// agnostic biary search algorithm
int bs(vector<int> &arr, int tg)
{
    int start = 0;
    int end = arr.size() - 1;

    while (start <= end)
    {
        int mid = (start + end) / 2;
        bool asc = arr[start] < arr[end];
        if (tg == arr[mid])
        {
            return mid;
        }

        else if (asc)
        {
            if (tg < arr[mid])
            {
                end = mid - 1;
            }
            else
            {
                start = mid + 1;
            }
        }

        else
        {
            if (tg < arr[mid])
            {
                start = mid + 1;
            }
            else
            {
                end = mid - 1;
            }
        }
    }
    return -1;
}

// sorts in ascending
void bubblesort_asc(vector<int> &arr)
{
    int temp, n = arr.size();
    for (int a = 0; a < n - 1; a++)
    {
        for (int b = 0; b < n - 1 - a; b++)
        {
            if (arr[b] > arr[b + 1])
            {
                // this is classic logic to swap values
                temp = arr[b];
                arr[b] = arr[b + 1];
                arr[b + 1] = temp;
                // this also works if we allowed to use swao function
                // NOTE : only use any ine at a time otherwise it will swap the value once which is needed but than again it will swap so it will nullify our swap usage.
                // swap(arr[b], arr[b + 1]);
            }
        }
    }
}

// sorts in descending
void bubblesort_dsc(vector<int> &arr)
{
    int temp, n = arr.size();
    for (int a = 0; a < n - 1; a++)
    {
        for (int b = 0; b < n - 1 - a; b++)
        {
            if (arr[b] < arr[b + 1])
            {
                // this is classic logic to swap values
                temp = arr[b + 1];
                arr[b + 1] = arr[b];
                arr[b] = temp;
                // this also works if we allowed to use swao function
                // NOTE : only use any ine at a time otherwise it will swap the value once which is needed but than again it will swap so it will nullify our swap usage.
                // swap(arr[b], arr[b + 1]);
            }
        }
    }
}

